import React from "react";
import "./OrderForm.css";
import PizzaForm from "./PizzaForm";
function OrderForm() {
  return (
    <header className="header">
      Teknolojik Yemekler
      <br />
      <br />
      <nav>
        <ul>
          <a>Ana Sayfa - </a>
          <a>Seçenekler - </a>
          <a>Sipariş Oluştur</a>
        </ul>
      </nav>
      <PizzaForm />
    </header>
  );
}

export default OrderForm;
